-- ----------------------------
-- Table structure for sc_trade
-- ----------------------------
DROP TABLE IF EXISTS `sc_trade`;
CREATE TABLE `sc_trade` (
  `id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '订单号，微信最多支持32位',
  `user_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户号',
  `type` tinyint NOT NULL COMMENT '类型，1-会员，2-商品，3-充值，4-课程',
  `fee` decimal(9,2) NOT NULL COMMENT '金额，单位元，支付宝最多支持精度(9,2)',
  `status` tinyint NOT NULL COMMENT '状态，1-已取消，2-待支付，3-已支付，4-退款中，5-已退款',
  `channel` tinyint NOT NULL COMMENT '渠道，1-支付宝，2-微信，3-iOS',
  `mode` tinyint NOT NULL COMMENT '方式，1-APP，2-扫码，3-公众号',
  `platform` tinyint NOT NULL COMMENT '平台，1-Android，2-iOS',
  `name` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '名称，微信最多支持128位',
  `expire_time` datetime NOT NULL COMMENT '最晚支付时间',
  `refund_status` tinyint NOT NULL COMMENT '退款状态，1-无退款，2-全额退款，3-部分退款',
  `refund_fee` decimal(9,2) NOT NULL COMMENT '已退款金额，单位元，支付宝最多支持精度(9,2)',
  `failure_reason` text CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '失败原因',
  `out_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '第三方支付平台订单号，支付宝最多支持64位',
  `out_user_id` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '第三方支付平台用户号，微信最多支持128位',
  `refund_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '退款订单号',
  `out_refund_id` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '第三方支付平台退款订单号，支付宝最多支持64位',
  `passback_params` varchar(127) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '回传参数，微信最多支持127位',
  `ios_receipt` varchar(15000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'iOS支付票据，防止重复使用票据',
  `real` tinyint NOT NULL COMMENT '真实数据，0-否，1-是',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='交易表';

