-- ----------------------------
-- Table structure for sc_withdrawal
-- ----------------------------
DROP TABLE IF EXISTS `sc_withdrawal`;
CREATE TABLE `sc_withdrawal` (
  `id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT 'ID',
  `user_id` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '用户ID',
  `event_type` tinyint unsigned NOT NULL COMMENT '事件类型',
  `wallet_type` tinyint unsigned NOT NULL COMMENT '钱包类型，1-iOS，2-Android',
  `fee` decimal(9,2) unsigned NOT NULL COMMENT '金额',
  `status` tinyint NOT NULL DEFAULT '1' COMMENT '状态，1-未审核，2-已通过，3-已拒绝',
  `channel` tinyint NOT NULL COMMENT '提现渠道，1-银行卡，2-支付宝，3-微信打款',
  `application_time` datetime NOT NULL COMMENT '申请时间',
  `auditor_id` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '审核人',
  `auditor_name` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '审核人名称',
  `pass_time` datetime DEFAULT NULL COMMENT '通过时间',
  `reject_reason` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '拒绝原因',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='提现表';

-- ----------------------------
-- Records of sc_withdrawal
-- ----------------------------
BEGIN;
COMMIT;

SET FOREIGN_KEY_CHECKS = 1;
