INSERT INTO `sc_security_staff_log` (`id`, `staff_id`, `ip`, `time`, `operation`, `status`, `parameters`, `result`, `create_time`, `update_time`) VALUES (2884, 'c39edd7094141ea6123d2acc2ee11ac5', '0:0:0:0:0:0:0:1', '2019-02-13 01:36:53', '更新文章', 1, '[{\"id\":\"f836eac1889648339f01252d0be2c5fe\",\"title\":\"广告\",\"type\":0,\"typeDesc\":\"富文本\",\"content\":\"<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;利空出尽是利好？今日，大量预亏预降股涨停，此前业绩炸雷的阴云似乎一扫而空。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2月12日，两市震荡上行，沪指创今年以来新高，创业板指三连阳，截至收盘创业板指涨1.23%。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img style=\\\"margin: 8px 0px; padding: 0px; border: none; font: inherit; vertical-align: middle; display: inline-block; width: 800px;\\\" src=\\\"https://image.cailianpress.com/admin/20190212/220916rURnC2rike8G.jpg\\\" alt=\\\"image\\\" /></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;业绩预告看，截至1月31日创业板有84家公司预亏，其中2018年净利润预亏下限超5亿元的公司有42家，超10亿元的公司23家。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;但猪年开市至今两个交易日，前述84家预亏的创业板公司除乐视网累计下跌1.90%外，其余&ldquo;清一色&rdquo;收涨。两日涨幅超10%的公司达7家，其中初灵信息更已四连板。随着商誉出清，有机构指出，创业板历史性盈利底部将出现，2019年将逐季度改善。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img style=\\\"margin: 8px 0px; padding: 0px; border: none; font: inherit; vertical-align: middle; display: inline-block; width: 800px;\\\" src=\\\"https://image.cailianpress.com/admin/20190212/220925WjOWaikLHkh5.jpg\\\" alt=\\\"image\\\" /></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不过，大量预亏预降股涨停，炒作迹象明显，投资者还是应当注意投资风险。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">业绩预亏后四连板</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Wind数据显示，目前创业板共有742家公司，84家公司去年净利润出现亏损，净利预亏下限超5亿元的公司达42家，超10亿元的达23家，超20亿元共8家，分别是坚瑞沃能、华录百纳、掌趣科技、劲胜智能、联建光电、盛运环保、富临精工和金龙机电。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">安信证券指出，按照已披露业绩预告和业绩快报的情况看，创业板创下历史上最差业绩，可比口径下2018年预告业绩归母净利润同比负增长47.06%，较2017年进一步明显下滑。</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;其中，坚瑞沃能2018年业绩预亏超50亿元居首位，华录百纳和掌趣科技预亏金额均在31亿元以上。但猪年开市至今两个交易日，坚瑞沃能累计涨幅已达7.97%、华录百纳上涨3.62%、掌趣科技累计上涨5.19%。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img style=\\\"margin: 8px 0px; padding: 0px; border: none; font: inherit; vertical-align: middle; display: inline-block; width: 800px;\\\" src=\\\"https://image.cailianpress.com/admin/20190212/220949tYrLv9572kSK.jpg\\\" alt=\\\"image\\\" /></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;2月1日狗年最后一个交易日，创业板指开始强势反弹，当日收盘大涨3.52%，迪威迅、永清环保、三维丝和初灵信息等2018年业绩预亏的多只创业板股票强势涨停。2月11日和12日，猪年开市首两个交易日，创业板继续大涨，涨幅分别达3.53%和1.23%。其中前述84家预亏的创业板公司，2月11日和12日分别有4家和2家公司涨停。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">四连板的初灵信息最为强势。初灵信息2月12日高开高走，迅速封死涨停，报14.39元，全日成交2.24亿元，最新市值33.08亿元。自1月31日至今，初灵信息连续第四日涨停。</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img style=\\\"margin: 8px 0px; padding: 0px; border: none; font: inherit; vertical-align: middle; display: inline-block; width: 800px;\\\" src=\\\"https://image.cailianpress.com/admin/20190212/221001sSoLjdxUW6m4.jpg\\\" alt=\\\"image\\\" /></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;在四连板前，因为业绩大幅预亏，初灵信息曾吃下一个跌停板。初灵信息传统主业是数据接入，近年来通过外延并购切入大数据挖掘、处理、分析和应用等领域。1月29日晚间，初灵信息披露，预计2018年净利润为-3.05亿元至-3亿元，亏损的主要原因是子公司业绩不如预期，公司计提大额商誉减值准备。2018年三季度报显示，初灵信息存在8.23亿元商誉。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">巨亏消息披露后1月30日初灵信息股价&ldquo;一字&rdquo;跌停，但就在跌停当晚，该公司预告一季度净利润同比增长720%至750%。消息刺激下，初灵信息至今收获四连板，也成为创业板80多家预亏公司中，近期涨幅最高的标的。</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">预亏公司陆续反弹</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;业绩爆雷只是表面，大量的商誉减值对于创业板业绩造成重击。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;创业板公司的商誉减值并未较2017年收敛，反而环比上升。截至2018年三季度末，创业板商誉规模达2763亿元，占含商誉公司净资产比重达23.5%。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Wind数据显示，截至1月31日已有约108家创业板公司在年报业绩预告中对于商誉减值问题做出风险提示，但仅有部分公司披露了商誉减值的预估计提数额。据安信证券不完全统计，2018年创业板商誉减值已经超过150亿元，占比全年业绩接近30%。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;商誉出清后，部分创业板公司在二级市场颇为强势。2月1日至今，创业板指已收获三连阳，累计涨幅8.49%。如果只观察去年业绩预亏的84家创业板公司，最近三个交易日除乐视网下跌外，其余83家预亏公司清一色上涨，其中38家预亏公司累计涨幅在10%以上，7家公司累计涨幅在15%以上，初灵信息和锦富技术累计涨幅已达33.12%和22.5%。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">与此同时，2018年预亏的创业板公司中，已有初灵信息、探路者、联创互联披露2019年一季度业绩预告，当期净利润均显著增长，其中探路者预计2019年第一季度净利润盈利3880万到4550万元，同比增长75%到105%；联创互联预计今年一季度净利润为3500万至4300万元，同比22.29%至 50.24%。</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;伴随着商誉减值，在部分机构看来，创业板历史性盈利底部将出现，2019将逐季度改善。国盛证券指出，依据业绩预告估算，创业板或在2018年年报迎来历史性低点，2019一季度由于高基数的原因可能仍底部震荡，但从2019二季度开始创业板业绩或先于主板见底，逐步改善，一个季度比一个季度好。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">仍需警惕短期炒作风险</span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;不止创业板，今日大量绩差股出现涨停。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;从盘面上看，除新股和ST股外共有68股涨停，但其中业绩预亏、预降以及未预告业绩但去年三季报亏损或下降的个股有42只，占比近三分之二，概念炒作的迹象较明显。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;涨停的预亏股中大晟文化较引人关注，其因影视行业和游戏行业的政策环境发生较大变化，行业监管持续加强，市场竞争加剧，影视业务和游戏业务收入未达预期以及部分子公司存在商誉减值风险，需要计提商誉减值准备等原因，预计2018年度亏损10亿元&mdash;15亿元。</p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<img style=\\\"margin: 8px 0px; padding: 0px; border: none; font: inherit; vertical-align: middle; display: inline-block; width: 800px;\\\" src=\\\"https://image.cailianpress.com/admin/20190212/221039DoplJIJAEXn9.jpg\\\" alt=\\\"image\\\" /></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0);\\\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;自1月30日预亏以来大晟文化已经连续4个跌停板，今日早间开盘仍然跌停，并有80多万手封盘，在临近午间收盘的时候，突然3笔大单直接买进80多万手封单，成交近5亿元，占全天成交的90%以上，并直线拉至涨停，后虽有反复，但收盘仍封死涨停板。<span style=\\\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\\\">深交所盘后龙虎榜信息显示，当天参与博弈的都是营业部游资，榜上前5买入营业部华泰证券占3席，兴业证券占2席，其中兴业证券佛山魁奇路营业部买入最多，达1.4亿元。</span></p>\",\"category\":{\"id\":\"4e68a7e5c07741739162437726213ce9\",\"name\":\"广告\"},\"seq\":0,\"display\":1,\"displayDesc\":\"上架\",\"hot\":1}]', '{\"status\":true,\"code\":200}', '2019-02-13 01:36:56', '2019-02-13 01:36:56');
