INSERT INTO `sc_security_staff_log` (`id`, `staff_id`, `ip`, `time`, `operation`, `status`, `parameters`, `result`, `create_time`, `update_time`) VALUES (2891, 'c39edd7094141ea6123d2acc2ee11ac5', '120.229.251.136', '2019-02-15 16:03:24', '更新文章', 1, '[{\"id\":\"f836eac1889648339f01252d0be2c5fe\",\"title\":\"广告\",\"type\":0,\"typeDesc\":\"富文本\",\"content\":\"<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">首先大家科普一下你们的交易费用组成，打开你的电脑版的炒股软件，然后点击历史成交，你会发现里面有3列，分别是佣金、印花税、过户费，他们构成了你的交易费用。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">印花税是国家收取，固定千分之一，买入不收费，卖出才收费。过户费是沪市按照成交金额0.02&permil;双向收取过户费，深市不收，就几块钱，可以忽略不计。这些都是国家收取，你在任何一家券商都无法改变。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">但佣金确是可以改变的，而各家券商的佣金之间有很大差别和水分。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetic