inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">ETF取消最低5元手续费的好处</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">由于大部分散户的资金量有限，买卖ETF的资金量就更小，如果每次最低5元手续费，相当于抬高了成本。同时，本次按万1.2比例无差别计算佣金，哪怕你想拿ETF做T都没有后顾之忧</span></span></p>\",\"category\":{\"id\":\"4e68a7e5c07741739162437726213ce9\",\"name\":\"广告\"},\"seq\":0,\"display\":1,\"displayDesc\":\"上架\",\"hot\":1}]', '{\"status\":true,\"code\":200}', '2019-02-15 16:03:24', '2019-02-15 16:03:24');
INSERT INTO `sc_security_staff_log` (`id`, `staff_id`, `ip`, `time`, `operation`, `status`, `parameters`, `result`, `create_time`, `update_time`) VALUES (2892, 'c39edd7094141ea6123d2acc2ee11ac5', '120.229.251.136', '2019-02-15 16:03:24', '更新文章页面', 1, '[{\"id\":\"f836eac1889648339f01252d0be2c5fe\"}]', '\"content/articleUpdate\"', '2019-02-15 16:03:24', '2019-02-15 16:03:24');
INSERT INTO `sc_security_staff_log` (`id`, `staff_id`, `ip`, `time`, `operation`, `status`, `parameters`, `result`, `create_time`, `update_time`) VALUES (2893, 'c39edd7094141ea6123d2acc2ee11ac5', '120.229.251.136', '2019-02-15 16:04:08', '更新文章', 1, '[{\"id\":\"f836eac1889648339f01252d0be2c5fe\",\"title\":\"极速开户 足不出户\",\"type\":0,\"typeDesc\":\"富文本\",\"content\":\"<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">首先大家科普一下你们的交易费用组成，打开你的电脑版的炒股软件，然后点击历史成交，你会发现里面有3列，分别是佣金、印花税、过户费，他们构成了你的交易费用。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">印花税是国家收取，固定千分之一，买入不收费，卖出才收费。过户费是沪市按照成交金额0.02&permil;双向收取过户费，深市不收，就几块钱，可以忽略不计。这些都是国家收取，你在任何一家券商都无法改变。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">但佣金确是可以改变的，而各家券商的佣金之间有很大差别和水分。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">这些都是常识，这些钱并不是个小数，你可以打开自己的软件看一下，统计一下你一个月交出去多少佣金。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">这里对于佣金高于万1.2以上的粉丝送一个粉丝福利，海通证券，万1.2开户。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">海通证券是中国排名前三的超级大券商。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">为什么要和超级大券商合作？</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">第一个优点是营业部多，因为从未开通创业板的用户无论哪个券商都必须去营业部现场开通，如果是小券商在偏远地区根本没有营业部，难道还要去省城办业务？</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">第二个优点是下单快，对于做超短线的打板客，下单速度就是生命，超级大户还会花钱买通道提速，比如炒股养家老师就是全国速度最快的。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">第三个优点是安全性，接下来大概率会放宽外资券商业务，对于国内券商会有很大冲击，必定会有小券商被淘汰。</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">&nbsp;</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">福利如下：</span></span></p>\\n<p style=\\\"margin: 0px; padding: 0px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-size: 18px; line-height: 30px; font-family: \'Microsoft YaHei\', \'WenQuanYi Micro Hei\', \'Helvetica Neue\', Verdana, Arial, Helvetica, SimHei, sans-serif; vertical-align: baseline; -webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei