-webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-align: left;\\\"><span style=\\\"font-family: Microsoft YaHei, WenQuanYi Micro Hei, Helvetica Neue, Verdana, Arial, Helvetica, SimHei, sans-serif;\\\"><span style=\\\"font-size: 18px;\\\">由于大部分散户的资金量有限，买卖ETF的资金量就更小，如果每次最低5元手续费，相当于抬高了成本。同时，本次按万1.2比例无差别计算佣金，哪怕你想拿ETF做T都没有后顾之忧</span></span></p>\",\"category\":{\"id\":\"4e68a7e5c07741739162437726213ce9\",\"name\":\"广告\"},\"seq\":0,\"display\":1,\"displayDesc\":\"上架\",\"hot\":1}]', '{\"status\":true,\"code\":200}', '2019-02-18 21:10:37', '2019-02-18 21:10:37');
